                        <TextField size= "small" sx={{width: '90%', p: 0}} style={{ margin: '0 auto', marginBottom: '15px'}} InputLabelProps={{style: labelStyle}} id="outlined-basic" label="Код субъекта финансового мониторинга" variant="outlined" />
                        <FormControl size= "small" sx={{ m: 1, width: '90%' }} style={{ margin: '0 auto', marginBottom: '15px'}}>
                            <InputLabel id="demo-simple-select-label">И/ИЛИ</InputLabel>
                                <Select
                                    labelId="demo-simple-select-label"
                                    id="demo-simple-select-label"
                                    label = "И/ИЛИ"                                
                                    value={aOr4}
                                    onChange={event => {
                                        setAOr4(event.target.value)
                                    }}
                                    MenuProps={MenuProps}
                                    >
                                        <MenuItem value={'none'}>...</MenuItem>
                                        <MenuItem value={'and'}>И</MenuItem>
                                        <MenuItem value={'or'}>ИЛИ</MenuItem>
                            </Select>
                        </FormControl>
                    </>
                )}
                {fourthFilter == 'operNumber' && (
                    <>
                        <TextField size= "small" sx={{width: '90%', p: 0}} style={{ margin: '0 auto', marginBottom: '15px'}} InputLabelProps={{style: labelStyle}} id="outlined-basic" label="Номер операции" variant="outlined" />
                        <FormControl size= "small" sx={{ m: 1, width: '90%' }} style={{ margin: '0 auto', marginBottom: '15px'}}>
                            <InputLabel id="demo-simple-select-label">И/ИЛИ</InputLabel>
                                <Select
                                    labelId="demo-simple-select-label"
                                    id="demo-simple-select-label"
                                    label = "И/ИЛИ"                                
                                    value={aOr4}
                                    onChange={event => {
                                        setAOr4(event.target.value)
                                    }}
                                    MenuProps={MenuProps}
                                    >
                                        <MenuItem value={'none'}>...</MenuItem>
                                        <MenuItem value={'and'}>И</MenuItem>
                                        <MenuItem value={'or'}>ИЛИ</MenuItem>
                            </Select>
                        </FormControl>
                    </>
                )}
                {fourthFilter == 'memberMaincode' && (
                    <>
                        <TextField size= "small" sx={{width: '90%', p: 0}} style={{ margin: '0 auto', marginBottom: '15px'}} InputLabelProps={{style: labelStyle}} id="outlined-basic" label="ИИН/БИН 2" variant="outlined" />
                        <FormControl size= "small" sx={{ m: 1, width: '90%' }} style={{ margin: '0 auto', marginBottom: '15px'}}>
                            <InputLabel id="demo-simple-select-label">И/ИЛИ</InputLabel>
                                <Select
                                    labelId="demo-simple-select-label"
                                    id="demo-simple-select-label"
                                    label = "И/ИЛИ"                                
                                    value={aOr4}
                                    onChange={event => {
                                        setAOr4(event.target.value)
                                    }}
                                    MenuProps={MenuProps}
                                    >
                                        <MenuItem value={'none'}>...</MenuItem>
                                        <MenuItem value={'and'}>И</MenuItem>
                                        <MenuItem value={'or'}>ИЛИ</MenuItem>
                            </Select>
                        </FormControl>
                    </>
                )}
                {aOr4 !== 'none' && (
                    <FormControl size= "small" sx={{ m: 1, width: '90%' }} style={{ margin: '0 auto', marginBottom: '15px'}}>
                        <InputLabel id="demo-simple-select-label">Фильтр</InputLabel>
                        <Select
                            labelId="demo-simple-select-label"
                            id="demo-simple-select-label"
                            label = "Фильтр"                                
                            value={fifthFilter}
                            onChange={handleFifth}
                            MenuProps={MenuProps}
                            >
                                <MenuItem value={'cfmMainCode'}>ИИН/БИН 1</MenuItem>
                                <MenuItem value={'messNumber'}>Внутренний для СФМ номер сообщения</MenuItem>
                                <MenuItem value={'cfmCode'}>Код субъекта финансового мониторинга</MenuItem>
                                <MenuItem value={'operNumber'}>Номер операции</MenuItem>
                                <MenuItem value={'memberMaincode'}>ИИН/БИН 2</MenuItem>
                        </Select>
                    </FormControl>
                )}

                {/* FIFTH VALUE ********************************************************* */}
                {fifthFilter == 'cfmMainCode' && (
                    <>
                        <TextField size= "small" sx={{width: '90%', p: 0}} style={{ margin: '0 auto', marginBottom: '15px'}} InputLabelProps={{style: labelStyle}} id="outlined-basic" label="ИИН/БИН 1" variant="outlined" />
                    </>
                )}
                {fifthFilter == 'messNumber' && (
                    <>
                        <TextField size= "small" sx={{width: '90%', p: 0}} style={{ margin: '0 auto', marginBottom: '15px'}} InputLabelProps={{style: labelStyle}} id="outlined-basic" label="Внутренний для СФМ номер сообщения" variant="outlined" />
                    </>
                )}
                {fifthFilter == 'cfmCode' && (
                    <>
                        <TextField size= "small" sx={{width: '90%', p: 0}} style={{ margin: '0 auto', marginBottom: '15px'}} InputLabelProps={{style: labelStyle}} id="outlined-basic" label="Код субъекта финансового мониторинга" variant="outlined" />
                    </>
                )}
                {fifthFilter == 'operNumber' && (
                    <>
                        <TextField size= "small" sx={{width: '90%', p: 0}} style={{ margin: '0 auto', marginBottom: '15px'}} InputLabelProps={{style: labelStyle}} id="outlined-basic" label="Номер операции" variant="outlined" />
                    </>
                )}
                {fifthFilter == 'memberMaincode' && (
                    <>
                        <TextField size= "small" sx={{width: '90%', p: 0}} style={{ margin: '0 auto', marginBottom: '15px'}} InputLabelProps={{style: labelStyle}} id="outlined-basic" label="ИИН/БИН 2" variant="outlined" />
                    </>
                )}

                {firstFilter.length > 0 && (

                    <div style={{ marginTop: '50px', display: 'flex', justifyContent: 'flex-end', width: '90%'}}>
                        <Button
                            sx={{
                                height: '34px',
                            backgroundColor: "#33B6FF",
                            color: 'white',
                            width: '100px',
                        }}
                        variant="contained"
                        onClick={getData}
                        >
                            {!loading && (
                                <span style={{ fontWeight: '600' }} className='buttonSearch'>Запрос</span>
                            )}
                            {loading && (
                                <span style={{ fontWeight: '600' }} className='buttonSearch'>Отмена</span>
                            )}
                        </Button>
                    </div>
                )}
            </div>
            <div className="tableBlock">
                <div className="tableSam">
                    {loading && (
                        <Box sx={{ width: '100%' }}>
                        <LinearProgress />
                        </Box>
                    )}
                    {!loading && (
                        <ResultTable/>
                    )}
                </div>
                {!loading && (
                    <div style={{ marginTop: '100px', display: 'flex', justifyContent: 'flex-end', width: '95%'}}>
                        <IconButton onClick={download} aria-label="download" size="large">
                            <FileDownloadIcon fontSize="inherit" />
                        </IconButton>
                    </div>
                )}
            </div>
        </div>
    )
}


function ResultTable(props) {
    
    return (
        <TableContainer component={Paper}>
            <Table sx={{ minWidth: 650 }} size="small" aria-label="a dense table">
            <TableHead>
                <TableRow>
                {Object.values(dictionaryOfTable).map((column) => (
                    <TableCell sx={{ whiteSpace: 'nowrap' }} key={column}>{column}</TableCell>
                    ))}
                </TableRow>
            </TableHead>
            <TableBody>
                {/* {rows.map((row) => (
                    <TableRow
                    key={row.name}
                    sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
                    >
                    <TableCell component="th" scope="row">
                    {row.name}
                    </TableCell>
                    <TableCell align="right">{row.calories}</TableCell>
                    <TableCell align="right">{row.fat}</TableCell>
                    <TableCell align="right">{row.carbs}</TableCell>
                    <TableCell align="right">{row.protein}</TableCell>
                </TableRow>
                ))} */}
            </TableBody>
            </Table>
        </TableContainer>
    )
}

export default OracleTable
